script: |
  super -f text -I q5745.spq | sort > q5745.out

inputs:
  - name: q5745.spq
    data: |
      SELECT DISTINCT + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN ( + col0 ) AND col2 * - CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q5745.out
    data: |
      46
      64
      75
